import React, { Component } from "react";
import { Line, SteppedLine, PolyLine, Circle, Rectangle } from "draw-shape-reactjs";

// import { geometry, Image, Surface, Path, Text, Group } from "@progress/kendo-drawing";
// const { Rect, Point, Size, transform } = geometry;

class HexagonCluster extends Component {
  constructor(props) {
    super(props);
    this.state = {
      hexagons: [],
    };
  }

  // createHexagone = ({startX, startY}) => {
  //     return (
  //       {}
  //       <Line >
  //     )
  // }

  // });

  render() {
    return (
      <div id="line">
        Hi There
        <Line
          key="0"
          // name="0"
          // label="0"
          // placeholder="dfsf"
          position="fixed"
          from={[100, 100]}
          to={[150, 100]}
          color="#1DBFE7"
        />
        <Line key="1" position="fixed" from={[150, 100]} to={[200, 150]} color="#1DBFE7" />
        <Line key="2" position="fixed" from={[200, 150]} to={[150, 200]} color="#1DBFE7" />
        <Line key="03" position="fixed" from={[150, 200]} to={[100, 200]} color="#1DBFE7" />
        <Line key="04" position="fixed" from={[100, 200]} to={[50, 150]} color="#1DBFE7" />
        <Line key="5" position="fixed" from={[50, 150]} to={[100, 100]} color="#1DBFE7" />
      </div>
    );
  }
}

export default HexagonCluster;
